import React, { useState } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

// Register chart components
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function MutualFundsData() {
  const [symbol, setSymbol] = useState('');
  const [data, setData] = useState(null);
  const [error, setError] = useState('');
  const [chartData, setChartData] = useState(null);

  // Function to fetch stock data
  const fetchData = async (stockSymbol) => {
    try {
      const response = await axios.get(`http://localhost:5000/stock/${stockSymbol}`);
      const stockData = response.data;

      setData(stockData);
      setError('');

      // Prepare chart data
      setChartData({
        labels: ['Current Price', 'Day High', 'Day Low', 'Previous Close'],
        datasets: [
          {
            label: `${stockSymbol.toUpperCase()} Prices`,
            data: [
              stockData.price,
              stockData.dayHigh,
              stockData.dayLow,
              stockData.previousClose,
            ],
            borderColor: 'rgba(75, 192, 192, 1)',
            backgroundColor: 'rgba(75, 192, 192, 0.2)',
            fill: true,
          },
        ],
      });
    } catch (err) {
      setError('Failed to fetch data. Please try again.');
      console.error('Error fetching stock data:', err.message);
    }
  };

  // Handle search
  const handleSearch = () => {
    if (!symbol) {
      setError('Please enter a stock symbol.');
      return;
    }
    fetchData(symbol);
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.header}>Mutual Funds Data Viewer</h1>
      <div style={styles.searchContainer}>
        <input
          type="text"
          placeholder="Enter Stock Symbol (e.g., AAPL)"
          value={symbol}
          onChange={(e) => setSymbol(e.target.value)}
          style={styles.input}
        />
        <button onClick={handleSearch} style={styles.button}>
          Search
        </button>
      </div>
      {error && <p style={styles.error}>{error}</p>}

      {data && (
        <div style={styles.dataContainer}>
          <h2>Stock Data for {symbol.toUpperCase()}</h2>
          <p><strong>Current Price:</strong> ${data.price}</p>
          <p><strong>High Price:</strong> ${data.dayHigh}</p>
          <p><strong>Low Price:</strong> ${data.dayLow}</p>
          <p><strong>Previous Close:</strong> ${data.previousClose}</p>
        </div>
      )}

      {chartData && (
        <div style={styles.chartContainer}>
          <Line
            data={chartData}
            options={{
              responsive: true,
              plugins: {
                legend: {
                  position: 'top',
                },
                title: {
                  display: true,
                  text: `${symbol.toUpperCase()} Prices Overview`,
                },
              },
            }}
          />
        </div>
      )}
    </div>
  );
}

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  header: {
    textAlign: 'center',
    color: '#007BFF',
  },
  searchContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: '20px',
  },
  input: {
    padding: '10px',
    width: '300px',
    marginRight: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
  },
  button: {
    padding: '10px 20px',
    borderRadius: '5px',
    border: 'none',
    backgroundColor: '#007BFF',
    color: 'white',
    cursor: 'pointer',
  },
  error: {
    color: 'red',
    textAlign: 'center',
  },
  dataContainer: {
    marginTop: '20px',
    textAlign: 'center',
  },
  chartContainer: {
    marginTop: '40px',
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '5px',
    backgroundColor: '#f9f9f9',
  },
};

export default MutualFundsData;
